The Exhibitionist (James Avalon, Sweet Sinner / 2014)

When a sexy young woman moves in next door, a dark secret awakens in Wyatt Chamberfield. He likes to watch. And one night, seeing her bring a young man home, he's mesmerized watching them make love through the bedroom window. The next morning, the young woman confronts him, but she's not angry or upset. She likes being watched, and their deviant relationship takes a dark turn. Starring the exciting new erotic phenom, Adrianna Chechik and the extraordinaire, James Deen. Also featured are Riley Reid, Kimberly Kane, Tyler Nixon, and Seth Gamble!

